import React from 'react'
import heart from '../icons/heart.svg';


function TreeBestMovies({ treeFirtsMovies }) {

    return (
        <div>
            {
                console.log(treeFirtsMovies)
            }
            {
                treeFirtsMovies.map(movie => {
                    return (
                        <div key={movie.id}>
                            <img src={"https://image.tmdb.org/t/p/w500/" + movie.backdrop_path} alt="bg" className="w-100 rounded-2" />
                            <div>
                                <p>{movie.title}</p>
                                <p>{movie.overview}</p>
                                <span> <img src={heart} alt="heart" /></span>
                            </div>
                        </div>
                    )
                })
            }
        </div>
    )
}

export default TreeBestMovies
